class SingleTimestepOutput():
    def __init__(self,
                 distance,
                 speed,
                 acceleration,
                 w_prime_balance,
                 segment,
                 power_in,
                 yaw,
                 elevation
                 ):
        self.distance = distance
        self.speed = speed
        self.acceleration = acceleration
        self.w_prime_balance = w_prime_balance
        self.segment=segment
        self.power_in=power_in
        self.yaw=yaw
        self.elevation=elevation

